import { ProductModel } from './product.model';
import { Injectable } from '../../node_modules/@angular/core';

@Injectable({
    providedIn : 'root'
})
export class ProductService {

    products: ProductModel[] = [
        new ProductModel("Honor Play", 19999, 4.2, "data:image/jpeg;base64,", 789, 1),
        new ProductModel("Titan Watch", 3000, 3.6, "data:image/jpeg;base64,", 345, 0),
        new ProductModel("Nike Shoes", 3400, 4.4, "data:image/jpeg;base64,", 799, 1),
        new ProductModel("HP Laptop", 66000, 5, "data:image/jpeg;base64,", 1000, 1),
        new ProductModel("Mi 3 Band", 2800, 4.1, "data:image/jpeg;base64,", 807, 1),
        new ProductModel("Mi LED TV 4C", 34000, 5, "data:image/jpeg;base64,", 578, 4),
        new ProductModel("Seagate 3TB", 6299, 3.8, "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ7PNP6R89q0REYBcgFA_CKuCoiHWJ-I64AQDkfpLpwE3fxDALDoQ&s", 900, 5),
        new ProductModel("Bag", 1676, 5, "data:image/jpeg;base64,", 5435, 0)
    ]
    getAllProducts():any[]{
        return this.products;
    }

    deleteProduct(productToBedeleted :  string)
    {
        //logic for delete array
       let index=this.products.findIndex(p => p.title == productToBedeleted);
       this.products.splice(index,2);
       console.log(this.products);
    }
    addAProduct( productToBedeleted : ProductModel)
    {
        this.products.push(productToBedeleted);        
    }
}



